import React, { Component } from 'react';

class checkbox extends Component {
    constructor(props){
        super(props);
        this.state = {
            fruits : [
                {id:1,name:'apple',isCheck:null},
                {id:2,name:'banana',isCheck:null},
                {id:3,name:'mango',isCheck:null},
                {id:3,name:'guva',isCheck:null},
                {id:4,name:'papaya',isCheck:null},
                {id:5,name:'kiwi',isCheck:null},
                {id:6,name:'pineapple',isCheck:null},
                {id:7,name:'strawberry',isCheck:null},
                {id:8,name:'banana',isCheck:null},
                {id:9,name:'orange',isCheck:null},
                {id:10,name:'peach',isCheck:null},
                {id:11,name:'melon',isCheck:null}
            ]
        }
    }
    render() {
        const {fruits} = this.state;

        return (
            <div>
                {fruits && fruits.length > 0 && fruits.map((fruit,index)=>{
                    return(
                       <div>
                            <input type="checkbox" value={fruit.name} />
                            <label>{fruit.name}</label>
                        </div>
                    )
                })
                }
            </div>
        );
    }
}

export default checkbox;
